// src/components/ManageUsers.jsx
import React, { useEffect, useState } from 'react';
import authServices from '../services/authServices';

const ManageUsers = () => {
  const [coordinators, setCoordinators] = useState([]);
  const [formData, setFormData] = useState({ coor_fname: '', coor_lname: '', coor_email: '', coor_password: '' });
  const [isEditing, setIsEditing] = useState(false);
  const [editingId, setEditingId] = useState(null);
  const [error, setError] = useState(null);

  // Fetch coordinators on component mount
  useEffect(() => {
    const fetchCoordinators = async () => {
      try {
        const data = await authServices.getCoordinators();
        setCoordinators(data);
      } catch (error) {
        setError('Failed to fetch coordinators');
      }
    };
    fetchCoordinators();
  }, []);

  // Handle form input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (isEditing) {
        // Update existing coordinator
        const updatedCoordinator = await authServices.updateCoordinator(editingId, formData);
        setCoordinators(coordinators.map((coordinator) => (coordinator.id === editingId ? updatedCoordinator : coordinator)));
      } else {
        // Create new coordinator
        const newCoordinator = await authServices.createCoordinator(formData);
        setCoordinators([...coordinators, newCoordinator]);
      }
      // Reset form
      setFormData({ coor_fname: '', coor_lname: '', coor_email: '', coor_password: '' });
      setIsEditing(false);
      setEditingId(null);
    } catch (error) {
      setError(error.message);
    }
  };

  // Edit coordinator
  const handleEdit = (coordinator) => {
    setFormData({
      coor_fname: coordinator.coor_fname,
      coor_lname: coordinator.coor_lname,
      coor_email: coordinator.coor_email,
      coor_password: '', // Do not pre-fill password for security reasons
    });
    setIsEditing(true);
    setEditingId(coordinator.id);
  };

  // Delete coordinator
  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this coordinator?')) {
      try {
        await authServices.deleteCoordinator(id);
        setCoordinators(coordinators.filter((coordinator) => coordinator.id !== id));
      } catch (error) {
        setError(error.message);
      }
    }
  };

  return (
    <div>
      <h2>Manage Users</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="coor_fname"
          placeholder="First Name"
          value={formData.coor_fname}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="coor_lname"
          placeholder="Last Name"
          value={formData.coor_lname}
          onChange={handleChange}
          required
        />
        <input
          type="email"
          name="coor_email"
          placeholder="Email"
          value={formData.coor_email}
          onChange={handleChange}
          required
        />
        <input
          type="password"
          name="coor_password"
          placeholder="Password"
          value={formData.coor_password}
          onChange={handleChange}
          required
        />
        <button type="submit">{isEditing ? 'Update Coordinator' : 'Add Coordinator'}</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {coordinators.map((coordinator) => (
            <tr key={coordinator.id}>
              <td>{coordinator.coor_fname}</td>
              <td>{coordinator.coor_lname}</td>
              <td>{coordinator.coor_email}</td>
              <td>
                <button onClick={() => handleEdit(coordinator)}>Edit</button>
                <button onClick={() => handleDelete(coordinator.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ManageUsers;
